const body = $json.body.form_response;
const answers = body.answers || [];
const fields = body.definition.fields || [];

// yardƒ±mcƒ± fonksiyon: field id'den title'ƒ± bul
function getTitleById(id) {
  return fields.find(f => f.id === id)?.title?.toLowerCase() || '';
}

// her answer i√ßin title-title e≈ülemesi kur
const data = {};
for (const a of answers) {
  const title = getTitleById(a.field.id);
  if (title.includes('first name')) data.first_name = a.text;
  if (title.includes('last name')) data.last_name = a.text;
  if (title.includes('company')) data.company = a.text;
  if (a.type === 'email') data.email = a.email;
}

// domain t√ºret
if (data.email && data.email.includes('@')) {
  data.domain = data.email.split('@')[1];
}

return [{ json: data }];

const lead = $json;

let score = 0;

// ≈ûirket b√ºy√ºkl√ºƒü√º
if (lead.employees_count > 1000) score += 40;
else if (lead.employees_count > 100) score += 25;
else if (lead.employees_count > 10) score += 10;

// √úlke √∂nceliƒüi (√∂rnek)
if (lead.country === 'United States' || lead.country === 'United Kingdom') score += 15;

// Sekt√∂r hedefi
const targetIndustries = ['Software', 'Internet', 'Information Technology'];
if (targetIndustries.includes(lead.industry)) score += 20;

// E-posta domain kontrol√º
if (!lead.domain.includes('gmail') && !lead.domain.includes('yahoo')) score += 10;

// LinkedIn bilgisi varsa
if (lead.linkedin_url) score += 5;

// Sonu√ß
let leadTier = 'Cold';
if (score >= 70) leadTier = 'Hot';
else if (score >= 40) leadTier = 'Warm';

return [{
  json: {
    ...lead,
    lead_score: score,
    lead_tier: leadTier,
    timestamp: new Date().toISOString()
  }
}];

